import React from "react";

const test = ` <div className="boo">
      <hr />
      Hi I'm a Boo component with the title:
    <h2>{props.block.title}</h2>
    </div>`;

const Boo = (props) => {
  return (
    <div className="boo">
      <hr />
      Hi I'm a Boo component with the title:
    <h2>{props.block.title}</h2>
    </div>
  )
}

export default Boo;
